B.Bm=new A.lF("CIEX",B.LJ,B.MR,B.Lm,"'Desenvolvi toda a interface do Video Wall do CIEX - DT LAGOA em Flutter, incluindo gr\xe1ficos, indicadores e v\xeddeos institucionais, integrada \xe0s APIs oficiais para atualiza\xe7\xe3o em tempo real. Implementei tamb\xe9m o salvamento e exibi\xe7\xe3o de p\xe1ginas web, al\xe9m de um gerenciador de m\xeddias que permite adicionar e reproduzir v\xeddeos e imagens no aplicativo. Todos os dados s\xe3o persistidos localmente com Isar, garantindo opera\xe7\xe3o est\xe1vel mesmo sem internet. A interface foi projetada para ser modular, escal\xe1vel e otimizada para telas de grande formato.","O projeto CIEX tem como objetivo criar um g\xeameo digital da Lagoa dos Patos para integrar dados em tempo real e permitir o monitoramento e a previs\xe3o de eventos clim\xe1ticos extremos no sul do Rio Grande do Sul. No projeto, sou respons\xe1vel pelo desenvolvimento da interface do video wall, que exibe gr\xe1ficos, v\xeddeos, logos e informa\xe7\xf5es din\xe2micas de forma visual e interativa, utilizando Flutter com foco em desempenho, fluidez e design moderno.",B.Lx,"FURG",null,null,"Pesquisador Front-end",null,"O Centro Interinstitucional de Observa\xe7\xe3o e Previs\xe3o de Eventos Extremos (CIEX \u2013 FURG) lidera a cria\xe7\xe3o do Digital Twin Lagoa dos Patos (DT-LAGOA), uma plataforma digital de alta fidelidade para simular, monitorar e prever, em tempo real, fen\xf4menos meteocenogr\xe1ficos, hidrol\xf3gicos, hidrodin\xe2micos e eventos de inunda\xe7\xe3o no sul do Rio Grande do Sul.\n\nO projeto integra institui\xe7\xf5es, sensores ambientais, redes de monitoramento, supercomputa\xe7\xe3o e sistemas de visualiza\xe7\xe3o, oferecendo dados qualificados para \xf3rg\xe3os de seguran\xe7a, prefeituras, defesas civis, pesquisadores e tomadores de decis\xe3o.")
