B.Bo=new A.lF("Pinguim",B.KG,B.Lh,B.cP,"Fui respons\xe1vel pela implementa\xe7\xe3o da Clean Architecture, o que trouxe ao projeto maior escalabilidade, organiza\xe7\xe3o e facilidade de manuten\xe7\xe3o. Essa abordagem permitiu uma separa\xe7\xe3o clara de responsabilidades entre camadas, reduzindo a depend\xeancia entre m\xf3dulos e facilitando a evolu\xe7\xe3o do c\xf3digo ao longo do tempo.\n\nAl\xe9m do desenvolvimento t\xe9cnico, contribu\xed ativamente para o crescimento e a maturidade da equipe, promovendo mentorias sobre padr\xf5es arquiteturais, boas pr\xe1ticas de programa\xe7\xe3o e o uso eficiente de ferramentas como o Bloc, voltado ao gerenciamento reativo de estados.","Aplicativo que come\xe7ou como uma rede social de viagens e evoluiu para uma plataforma B2B voltada \xe0 gest\xe3o e conex\xe3o de experi\xeancias de viagem. Atuei como desenvolvedor experiente, respons\xe1vel pela defini\xe7\xe3o e implementa\xe7\xe3o da Clean Architecture, padroniza\xe7\xe3o da base de c\xf3digo e cria\xe7\xe3o de componentes reativos com Bloc. Tamb\xe9m liderei decis\xf5es t\xe9cnicas e mentorias sobre boas pr\xe1ticas, contribuindo para a maturidade e produtividade da equipe.",B.oK,"iTec/FURG-Embrapii",null,null,"Pesquisador J\xfanior",null,"Durante minha atua\xe7\xe3o no projeto \u2014 que inicialmente come\xe7ou como uma rede social de viagens e posteriormente passou a ter foco B2B, com \xeanfase na p\xe1gina de administra\xe7\xe3o \u2014 desempenhei um papel fundamental como membro experiente da equipe de desenvolvimento, colaborando em decis\xf5es t\xe9cnicas, defini\xe7\xe3o de arquitetura e na resolu\xe7\xe3o de problemas complexos")
